import styled from 'styled-components';

export const Container = styled.div`
  flex: 1;
  height: 100%;
  width: 100%;
  background: #f3f3f3;
`;

export const HeaderDiv = styled.div`
    background: #fff;
    flex-direction: row;
    height: 18%;
`;

export const Logo = styled.img`
    margin-top: 5%5%;
`;
